:{s:12:\"_multiwidget\";i:1;}','auto'),(121,'widget_custom_html','a:1:{s:12:\"_multiwidget\";i:1;}','auto'),(126,'recovery_keys','a:0:{}','auto'),(127,'theme_mods_twentytwentyfour','a:2:{s:18:\"custom_css_post_id\";i:-1;s:16:\"sidebars_widgets\";a:2:{s:4:\"time\";i:1722358989;s:4:\"data\";a:3:{s:19:\"wp_inactive_widgets\";a:0:{}s:9:\"sidebar-1\";a:3:{i:0;s:7:\"block-2\";i:1;s:7:\"block-3\";i:2;s:7:\"block-4\";}s:9:\"sidebar-2\";a:2:{i:0;s:7:\"block-5\";i:1;s:7:\"block-6\";}}}}','off'),(146,'can_compress_scripts','1','on'),(154,'_site_transient_wp_plugin_dependencies_plugin_data','a:1:{s:9:\"elementor\";a:35:{s:4:\"name\";s:78:\"Elementor Website Builder &#8211; Mais do que apenas um construtor de páginas\";s:4:\"slug\";s:9:\"elementor\";s:7:\"version\";s:6:\"3.23.4\";s:6:\"author\";s:115:\"<a href=\"https://elementor.com/?utm_source=wp-plugins&utm_campaign=author-uri&utm_medium=wp-dash\">Elementor.com</a>\";s:14:\"author_profile\";s:40:\"https://profiles.wordpress.org/elemntor/\";s:12:\"contributors\";a:1:{s:8:\"elemntor\";a:3:{s:7:\"profile\";s:40:\"https://profiles.wordpress.org/elemntor/\";s:6:\"avatar\";s:88:\"https://secure.gravatar.com/avatar/5da4d5137e6bbfaac62bc33164a10887?s=96&d=monsterid&r=g\";s:12:\"display_name\";s:9:\"Elementor\";}}s:8:\"requires\";s:3:\"6.0\";s:6:\"tested\";s:5:\"6.5.5\";s:12:\"requires_php\";s:3:\"7.4\";s:16:\"requires_plugins\";a:0:{}s:6:\"rating\";i:92;s:7:\"ratings\";a:5:{i:5;i:5921;i:4;i:208;i:3;i:99;i:2;i:96;i:1;i:555;}s:11:\"num_ratings\";i:6879;s:11:\"support_url\";s:47:\"https://wordpress.org/support/plugin/elementor/\";s:15:\"support_threads\";i:240;s:24:\"support_threads_resolved\";i:158;s:15:\"active_installs\";i:10000000;s:12:\"last_updated\";s:22:\"2024-08-05 10:50am GMT\";s:5:\"added\";s:10:\"2016-05-30\";s:8:\"homepage\";s:87:\"https://elementor.com/?utm_source=wp-plugins&utm_campaign=plugin-uri&utm_medium=wp-dash\";s:8:\"sections\";a:6:{s:11:\"description\";s:28504:\"<p><span class=\"embed-youtube\" style=\"text-align:center; display: block;\"><iframe loading=\"lazy\" class=\"youtube-player\" width=\"750\" height=\"422\" src=\"https://www.youtube.com/embed/le72grP_Q6k?version=3&#038;rel=1&#038;showsearch=0&#038;showinfo=1&#038;iv_load_policy=1&#038;fs=1&#038;hl=pt-BR&#038;autohide=2&#038;wmode=transparent\" allowfullscreen=\"true\" style=\"border:0;\" sandbox=\"allow-scripts allow-same-origin allow-popups allow-presentation allow-popups-to-escape-sandbox\"></iframe></span></p>\n<h4>O CONSTRUTOR DE SITES WORDPRESS Nº 1 DE ARRASTAR E SOLTAR SEM CÓDIGOS, QUE IMPULSIONA MAIS DE 16 MILHÕES DE SITES EM TODO O MUNDO, AGORA COM IA.</h4>\n<p>O Elementor, a principal plataforma de criação de sites do WordPress, permite que você crie sites profissionais e perfeitos em termos de pixels, de maneira integrada.</p>\n<p>Revolucione a forma como você constrói sites com a <a href=\"https://go.elementor.com/wp-repo-description-tab-elementor-ai/\" rel=\"nofollow ugc\">IA do Elementor</a>, uma integração nativa de IA. Crie seções completas, texto original, código e imagens instantaneamente, ou faça referência a outro site para recriar o layout dele no seu site.</p>\n<p>Desbloqueie todos os recursos com o <a href=\"https://go.elementor.com/wp-repo-description-tab-elementor-pro-pro-features/\" rel=\"nofollow ugc\">Elementor Pro</a>.</p>\n<h4>🌟 Crie sites profissionais impressionantes</h4>\n<ul>\n<li><strong><a href=\"https://go.elementor.com/feature-page-editor/\" rel=\"nofollow ugc\">Construtor de arrastar e soltar intuitivo</a></strong>: Crie qualquer site com nosso editor de arrastar e soltar sem códigos. Alcance a precisão no design com controle total sobre o layout e o estilo.</li>\n<li><strong><a href=\"https://go.elementor.com/wp-repo-description-tab-pro-features-feature-page/\" rel=\"nofollow ugc\">Ferramentas de design com pixels perfeitos</a></strong>: Envie SVGs, aplique máscaras, gradientes, sombras de caixa, efeitos de título, divisores de forma e use controles CSS integrados para personalização avançada.</li>\n<li><strong><a href=\"https://go.elementor.com/wp-repo-description-tab-library-full-website-kit/\" rel=\"nofollow ugc\">Biblioteca de modelos</a></strong>: Aplique kits de sites completos para configurações instantâneas ou escolha em uma vasta biblioteca de páginas únicas, blocos e modelos de pop-up. Crie e exporte seus próprios modelos para reutilização.</li>\n<li><strong><a href=\"https://go.elementor.com/feature-page-editor/\" rel=\"nofollow ugc\">Widgets avançados</a></strong>: Acesse mais de 40 widgets GRATUITOS, incluindo título, imagem, editor de texto, vídeo, botão, galeria, carrosséis e muito mais. Personalize e estilize os widgets para atender às suas necessidades de design com perfeição.</li>\n<li><strong><a href=\"https://go.elementor.com/wp-repo-description-tab-elementor-ai/\" rel=\"nofollow ugc\">Recursos de IA</a></strong>: Revolucione seu processo de criação de design e conteúdo com a integração nativa de IA. Crie imediatamente seções, texto, código e imagens, ou faça referência a layouts de outros sites.</li>\n</ul>\n<h4>🗝️ Principais recursos:</h4>\n<ul>\n<li><strong><a href=\"https://go.elementor.com/feature-page-global-settings/\" rel=\"nofollow ugc\">Sistema de design</a></strong>: Use o sistema de design do Elementor para obter cores, tipografia e elementos de design consistentes, garantindo uma aparência coesa e profissional.</li>\n<li><strong><a href=\"https://go.elementor.com/feature-page-responsive-design/\" rel=\"nofollow ugc\">Design responsivo</a></strong>: Otimize seu design para qualquer dispositivo com pontos de interrupção personalizados e ajustes específicos para cada dispositivo. Garanta uma experiência perfeita para os usuários de desktop, tablet e dispositivo móvel.</li>\n<li><strong>Formas de máscara</strong>: Transforme qualquer elemento, como uma imagem ou um vídeo, em qualquer forma que você queira para criar designs marcantes.</li>\n<li><strong>Transformação de CSS</strong>: Use a transformação de CSS para rotacionar, dimensionar e inclinar elementos, adicionando um estilo dinâmico ao seu site.</li>\n<li><strong>Animações de entrada</strong>: Adicione animações de entrada aos elementos para criar experiências de usuário envolventes e interativas.</li>\n<li><strong><a href=\"https://elementor.com/features/#SaveBackup\" rel=\"nofollow ugc\">Histórico de revisões</a></strong>: O recurso de histórico de revisões do Elementor permite que os usuários acompanhem e revertam para versões anteriores dos seus designs, proporcionando tranquilidade e flexibilidade durante o processo criativo.</li>\n<li><strong><a href=\"https://go.elementor.com/wp-repo-description-tab-developers-developers-website/\" rel=\"nofollow ugc\">Amigável para desenvolvedores</a></strong>: Equipado com ampla documentação, API, ferramentas para desenvolvedores e áreas de código personalizado, o Elementor oferece um ambiente propício para que os desenvolvedores ampliem seus recursos e criem soluções personalizadas.</li>\n<li><strong>Botões flutuantes</strong>: Melhore a interação do usuário com botões de ação flutuantes e personalizáveis que permanecem visíveis à medida que os usuários rolam a tela.</li>\n<li><strong><a href=\"https://go.elementor.com/wp-repo-description-tab-pro-features-industry-leading-theme-builder/\" rel=\"nofollow ugc\">Construtor de temas</a> [Pro]</strong>: O robusto construtor de temas do Elementor permite que você crie todas as partes do seu site, incluindo cabeçalhos, rodapés, layouts de posts únicos e páginas de arquivo, fornecendo controle total sobre a aparência do site.</li>\n<li><strong><a href=\"https://go.elementor.com/wp-repo-description-tab-pro-features-popup-builder/\" rel=\"nofollow ugc\">Construtor de pop-ups</a> [Pro]</strong>: Crie pop-ups chamativos com o construtor de pop-ups do Elementor, que conta com opções avançadas de direcionamento e acionamento para otimizar o envolvimento do usuário e as conversões.</li>\n<li><strong><a href=\"https://go.elementor.com/wp-repo-description-tab-pro-features-professional-form-builder-and-submission-log/\" rel=\"nofollow ugc\">Formulários</a> [Pro]</strong>: Crie e integre formulários personalizados, usando recursos avançados e integrações para capturar e gerenciar envios de forma eficaz.</li>\n<li><strong><a href=\"https://go.elementor.com/wp-repo-description-tab-pro-features-woocommerce-builder/\" rel=\"nofollow ugc\">Construtor do WooCommerce</a> [Pro]</strong>: Integre o Elementor ao WooCommerce para criar páginas de produtos personalizadas, layouts de loja, arquivos, carrinhos, páginas de finalização de compra, minha conta e muito mais, aumentando o apelo visual e a funcionalidade da sua loja.</li>\n<li><strong><a href=\"https://go.elementor.com/wp-repo-description-tab-pro-features-dynamic-content/\" rel=\"nofollow ugc\">Conteúdo dinâmico</a> [Pro]</strong>: Aproveite os recursos de conteúdo dinâmico para criar experiências personalizadas e interativas na web, conectando seus designs a várias fontes de dados.</li>\n<li><strong><a href=\"https://go.elementor.com/features-page-notes/\" rel=\"nofollow ugc\">Anotações</a> [Pro]</strong>: Melhore a colaboração da equipe usando o recurso de anotações do Elementor para deixar feedbacks e comentários diretamente na interface do design.</li>\n<li><strong>Código personalizado [Pro]</strong>: Insere código personalizado para estender a funcionalidade do seu site, oferecendo flexibilidade para personalizações avançadas.</li>\n<li><strong> CSS personalizado [Pro]</strong>: Aplique CSS personalizado para fazer o ajuste fino do estilo dos elementos, garantindo um controle preciso sobre os aspectos do design.</li>\n<li><strong><a href=\"https://go.elementor.com/wp-repo-description-tab-pro-features-motion-effects/\" rel=\"nofollow ugc\">Efeitos de movimento</a> [Pro]</strong>: Adicione efeitos de movimento avançados a elementos para proporcionar uma experiência de usuário mais dinâmica e envolvente.</li>\n<li><strong>Fontes e ícones personalizados [Pro]</strong>: Envie e use fontes e ícones personalizados para combinar com a identidade da sua marca.</li>\n</ul>\n<h4>😍 Widgets do Elementor GRATUITO</h4>\n<p>Desbloqueie o potencial do Elementor com nosso conjunto abrangente de widgets e ferramentas gratuitas, desenvolvido para otimizar seu processo de criação de sites e melhorar seus recursos de design:</p>\n<ul>\n<li><strong>Título</strong>. Adicione manchetes chamativas.</li>\n<li><strong>Imagem</strong>. Controle o tamanho, a opacidade e muito mais.</li>\n<li><strong>Editor de texto</strong>. Exatamente como o editor do WordPress.</li>\n<li><strong>Vídeo</strong>. Adicione vídeos do YouTube, do Vimeo, do Dailymotion ou auto-hospedados.</li>\n<li><strong>Botão</strong>. Crie botões interativos.</li>\n<li><strong>Link na biografia</strong>. Crie componentes de link na biografia para promover sua empresa/serviços.</li>\n<li><strong>Caixa de imagem</strong>. Uma caixa com imagem, título e texto.</li>\n<li><strong>Depoimentos</strong>. Depoimentos de clientes.</li>\n<li><strong>Ícone</strong>. Coloque um ou mais dos mais de 600 ícones disponíveis.</li>\n<li><strong>Caixa de ícones</strong>. Um ícone, um título manchete e um texto em um único widget.</li>\n<li><strong>Ícones sociais</strong>. Crie links para suas páginas sociais com os ícones do Facebook/X (antigo Twitter).</li>\n<li><strong>Galeria de imagens</strong>. Exiba suas imagens em uma grade.</li>\n<li><strong>Carrossel de imagens</strong>. Crie carrosséis rotativos ou controles deslizantes (sliders) para as imagens escolhidas.</li>\n<li><strong>Lista de ícones</strong>. Use qualquer ícone para criar uma lista com marcadores.</li>\n<li><strong>Contador</strong>. Mostre os números de forma crescente.</li>\n<li><strong>Barra de progresso</strong>. Inclua uma barra de progresso crescente.</li>\n<li><strong>Abas aninhadas</strong>. Exiba o conteúdo em abas verticais ou horizontais.</li>\n<li><strong>Sanfona aninhada</strong>. Exiba qualquer tipo de conteúdo em seções recolhíveis.</li>\n<li><strong>Alternar</strong>. Use o &#8220;Alternar&#8221; para ocultar ou exibir conteúdo, como perguntas frequentes (FAQ).</li>\n<li><strong>Classificação</strong>. Exibe quantas estrelas (ou outro ícone) os outros visitantes deram.</li>\n<li><strong>Alerta</strong>. Inclua uma caixa de alerta colorida para chamar a atenção do visitante.</li>\n<li><strong> HTML </strong>. Insira código na página.</li>\n<li><strong>Shortcode</strong>. Insira shortcodes de qualquer plugin na página.</li>\n<li><strong>Âncora de menu</strong>. Vincule qualquer menu a esta âncora.</li>\n<li><strong>Leia mais</strong>. Defina o limite &#8220;Leia mais&#8221; para o resumo nas páginas de arquivo.</li>\n<li><strong>Barra lateral</strong>. Adicione barras laterais à página.</li>\n<li><strong>Google Maps</strong>. Incorpore mapas na página.</li>\n<li><strong>SoundCloud</strong>. Adicione trechos de áudio do SoundCloud.</li>\n<li><strong>Divisor</strong>. Separe o conteúdo com um divisor projetado.</li>\n<li><strong>Espaçador</strong>. Adicione espaço entre elementos.</li>\n<li><strong>Caminho de texto</strong>. Anexe seu texto a um caminho.</li>\n<li><strong>E contando&#8230;</strong></li>\n</ul>\n<h4>🚀 Melhore seu site</h4>\n<p><strong><a href=\"https://go.elementor.com/wp-repo-description-tab-performance-performance-page/\" rel=\"nofollow ugc\">Sites com alto desempenho</a></strong>: O desempenho do site afeta a experiência do visitante e a classificação dos resultados da pesquisa. O Elementor, em parceria com o Google Chrome, melhora continuamente o desempenho sem comprometer o design.</p>\n<p><strong>Os principais recursos incluem:</strong></p>\n<ul>\n<li><strong>Saída DOM reduzida</strong>: Estrutura HTML otimizada para renderização mais rápida.</li>\n<li><strong>Carregamento de arquivos de mídia melhorado</strong>: Carregamento otimizado de imagens, vídeos e outros ativos de mídia.</li>\n<li><strong>Arquivos CSS e JS reduzidos</strong>: Folhas de estilo e scripts minimizados e concatenados para tempos de carregamento mais rápidos.</li>\n<li><strong>Carregamento lento</strong>: Carregamento adiado de recursos não críticos para melhorar a velocidade de carregamento inicial da página.</li>\n<li><strong>Carregamento mais rápido de fontes</strong>: Fornecimento eficiente de fontes da web para aumentar a velocidade de renderização dos textos.</li>\n<li><strong>Carregamento otimizado de ativos da interface</strong>: Carregamento eficiente de ativos como JavaScript e CSS para minimizar o bloqueio de renderização.</li>\n<li><strong>Armazenamento em cache de elementos</strong>: Armazene em cache os elementos de design acessados com frequência, para reduzir o tempo de resposta do servidor e melhorar o desempenho geral.</li>\n</ul>\n<p><em><strong>Quer melhorar o desempenho dos sites?</strong> Conheça o <a href=\"https://go.elementor.com/wp-repo-description-tab-elementor-io/\" rel=\"nofollow ugc\">Plugin Image Optimizer </a> da Elementor: um plugin WordPress fácil de usar que reduz facilmente o tamanho das imagens sem sacrificar a qualidade. Compatível com formatos populares como JPEG, PNG, WebP e GIF, ele garante um site visualmente impressionante e de alta velocidade – <a href=\"https://wordpress.org/plugins/image-optimization/\" rel=\"ugc\">baixe agora</a>!</em></p>\n<h4>🔥 Recursos do Elementor Pro</h4>\n<p>Crie sites inigualáveis e economize tempo, dinheiro e recursos com o construtor de sites completo do <a href=\"https://go.elementor.com/wp-repo-description-tab-elementor-pro-elementor-pro/\" rel=\"nofollow ugc\">Elementor Pro</a>. Tenha acesso a mais de 100 widgets, recursos e ferramentas profissionais.</p>\n<p><strong>Widgets de designs profissionais:</strong></p>\n<ol>\n<li><strong>Posts</strong>: Exibe os posts do seu blog com layouts e estilos personalizáveis.</li>\n<li><strong>Botões de compartilhamento</strong>: Permite que os visitantes compartilhem seu conteúdo com facilidade em várias plataformas de mídia social.</li>\n<li><strong>Portfólio</strong>: Apresente seu trabalho ou projetos com layouts de portfólio impressionantes.</li>\n<li><strong>Slides</strong>: Crie apresentações de slides dinâmicos com animações e transições personalizadas.</li>\n<li><strong>Formulário</strong>: Crie e personalize formulários avançados para interação com o usuário e coleta de dados.</li>\n<li><strong>Acesso</strong>: Adicione um formulário de acesso ou um módulo de cadastro de usuário ao seu site.</li>\n<li><strong>Menu de navegação</strong>: Personalize e estilize o menu de navegação do seu site para melhorar a experiência do usuário.</li>\n<li><strong>Manchete animada</strong>: Crie títulos principais que chamam a atenção com efeitos animados.</li>\n<li><strong>Tabela de preços</strong>: Exibe planos ou pacotes de preços em um formato estruturado e visualmente atraente.</li>\n<li><strong>Lista de preços</strong>: Exibe uma lista de preços ou serviços com opções de estilo personalizáveis.</li>\n<li><strong>Galeria</strong>: Crie lindas galerias de imagens com várias opções de layout e suporte a lightbox.</li>\n<li><strong>Caixa giratória</strong>: Adicione animações interativas com efeito de giro para destacar conteúdos ou recursos.</li>\n<li><strong>Chamada para ação</strong>: Estimule a interação do usuário e as conversões com seções de chamada para ação convincentes.</li>\n<li><strong>Carrossel de mídia</strong>: Exibe um carrossel de arquivos de mídia, como imagens ou vídeos.</li>\n<li><strong>Carrossel de depoimentos</strong>: Exibe depoimentos de clientes em um formato de carrossel como prova social.</li>\n<li><strong>Carrossel aninhado</strong>: Crie carrosséis aninhados para uma organização do conteúdo mais sofisticada.</li>\n<li><strong>Carrossel em loop</strong>: Exibe conteúdo em um carrossel em loop para visualização contínua.</li>\n<li><strong>Tabela de conteúdo</strong>: Gere uma tabela de conteúdo (índice) para artigos ou guias mais longos para melhorar a navegação.</li>\n<li><strong>Contagem regressiva</strong>: Adicione temporizadores com contagem regressiva para criar urgência em promoções ou eventos.</li>\n<li><strong>Página do Facebook</strong>: Incorpore o feed ou o conteúdo da sua página do Facebook ao seu site.</li>\n<li><strong>Bloco de citação</strong>: Destaque citações ou depoimentos com opções de formatação elegantes.</li>\n<li><strong>Modelo</strong>: Salve e reutilize modelos de design para manter a consistência da marca e do layout.</li>\n<li><strong>Avaliações</strong>: Apresente as avaliações e classificações dos clientes para aumentar a confiança e a credibilidade.</li>\n<li><strong>Botão do Facebook</strong>: Adicione botões para promover interações com sua página ou conteúdo do Facebook.</li>\n<li><strong>Incorporação do Facebook</strong>: Incorpore publicações ou conteúdo do Facebook ao seu site.</li>\n<li><strong>Comentários do Facebook</strong>: Ative os comentários do Facebook nas páginas ou posts do seu site.</li>\n<li><strong>Botão do PayPal</strong>: Integre botões do PayPal para facilitar os pagamentos on-line.</li>\n<li><strong>Botão do Stripe</strong>: Integre botões de pagamento do Stripe para facilitar transações on-line seguras.</li>\n<li><strong>Widget Lottie</strong>: Adicione animações Lottie para aumentar o apelo visual e o envolvimento.</li>\n<li><strong>Destaque de código</strong>: Exiba fragmentos de código (snippets) com destaque na sintaxe para melhorar a legibilidade.</li>\n<li><strong>Lista de reprodução de vídeos</strong>: Crie e personalize listas de reprodução para conteúdo de vídeo no seu site.</li>\n<li><strong>Mega menu</strong>: Personalize menus avançados para melhorar a navegação e exibir conteúdo complexo.</li>\n<li><strong>Fora da tela</strong>: Crie áreas fora da tela que deslizam para mostrar informações ou menus adicionais sem sobrecarregar o layout principal.</li>\n</ol>\n<p><strong>Widgets de temas profissionais:</strong><br />\nCrie e personalize todas as partes principais do seu site, incluindo cabeçalhos, rodapés, página de erro 404, arquivos globais e muito mais</p>\n<ol>\n<li><strong>Título do post</strong>: Personalize o título dos posts ou páginas individuais do blog.</li>\n<li><strong>Resumo do post</strong>: Exibe um breve resumo ou prévia dos seus posts do blog.</li>\n<li><strong>Conteúdo do post</strong>: Personalize a área de conteúdo principal dos posts ou páginas do seu blog.</li>\n<li><strong>Imagem destacada</strong>: Defina e personalize imagens destacadas para posts ou páginas do blog.</li>\n<li><strong>Caixa do autor</strong>: Exibe informações e biografias do autor nos posts do blog.</li>\n<li><strong>Comentários de posts</strong>: Personalize a aparência e a funcionalidade das seções de comentários no seu site.</li>\n<li><strong>Navegação em posts</strong>: Adicione links de navegação aos posts adjacentes para facilitar a navegação.</li>\n<li><strong>Informações do post</strong>: Exibe informações adicionais sobre os posts do blog, como autor e data.</li>\n<li><strong>Logo do site</strong>: Envie e personalize o logo do seu site para fins de marca.</li>\n<li><strong>Título do site</strong>: Personalize o título do seu site.</li>\n<li><strong>Título da página</strong>: Personalize o título de páginas individuais.</li>\n<li><strong>Barra de pesquisa</strong>: Adicione uma barra de pesquisa para permitir que os usuários pesquisem o conteúdo do seu site.</li>\n<li><strong>Caminhos de navegação (breadcrumbs)</strong>: Exiba caminhos de navegação hierárquicos para melhorar a navegação do usuário.</li>\n<li><strong>Sitemap</strong>: Gere um sitemap para melhorar a indexação nos mecanismos de pesquisa e a navegação do usuário.</li>\n<li><strong>Grade em loop</strong>: Crie e personalize layouts de grade para arquivos de posts de blogs ou listagens de produtos.</li>\n</ol>\n<p><strong>Widgets do WooCommerce profissionais:</strong><br />\nCrie e personalize uma experiência completa de compras on-line em todo o seu site.</p>\n<ol>\n<li><strong>Produto</strong>: Exiba produtos individuais com layouts e estilos personalizáveis.</li>\n<li><strong>Caminhos de navegação (breadcrumbs)</strong>: Exiba caminhos de navegação hierárquicos para melhorar a navegação do usuário na sua loja.</li>\n<li><strong>Título do produto</strong>: Personalize o título de produtos individuais.</li>\n<li><strong>Imagens de produtos</strong>: Defina e personalize imagens para listagens de produtos.</li>\n<li><strong>Preço do produto</strong>: Exibe o preço de produtos individuais.</li>\n<li><strong>Adicionar ao carrinho</strong>: Adicione botões personalizáveis de adicionar ao carrinho para facilitar a compra.</li>\n<li><strong>Classificação do produto</strong>: Exibe classificações e avaliações dos produtos.</li>\n<li><strong>Estoque do produto</strong>: Exibe a disponibilidade de estoque dos produtos.</li>\n<li><strong>Meta do produto</strong>: Exibe informações adicionais sobre produtos, como SKU e categorias.</li>\n<li><strong>Conteúdo do produto</strong>: Personalize a área de conteúdo principal das descrições dos produtos.</li>\n<li><strong>Descrição curta</strong>: Exibe breves resumos ou prévias de produtos.</li>\n<li><strong>Abas de dados do produto</strong>: Organize as informações do produto em seções com abas para melhorar a organização.</li>\n<li><strong>Informações adicionais</strong>: Exibe detalhes adicionais sobre os produtos, como dimensões e peso.</li>\n<li><strong>Produto relacionado</strong>: Exibe produtos relacionados para incentivar compras adicionais.</li>\n<li><strong>Vendas adicionais (upsells)</strong>: Promova a venda adicional de produtos para aumentar o valor médio do pedido.</li>\n<li><strong>Produtos</strong>: Exibe uma grade ou lista de produtos com configurações personalizáveis.</li>\n<li><strong>Adicionar ao carrinho personalizado</strong>: Personalize o botão adicionar ao carrinho para produtos específicos.</li>\n<li><strong>Páginas do WooCommerce</strong>: Crie e personalize páginas específicas do WooCommerce, como as páginas do carrinho e da finalização de compra.</li>\n<li><strong>Categorias de produtos</strong>: Exibe categorias de produtos para facilitar a navegação na sua loja.</li>\n<li><strong>Menu do carrinho</strong>: Exibe um ícone de carrinho no seu menu de navegação para facilitar o acesso ao carrinho de compras.</li>\n<li><strong>Carrinho</strong>: Personalize a aparência e a funcionalidade da página do carrinho de compras.</li>\n<li><strong>Finalização de compra</strong>: Personalize a aparência e a funcionalidade da página de finalização de compra.</li>\n<li><strong>Minha conta</strong>: Personalize a aparência e a funcionalidade da área da conta do cliente.</li>\n<li><strong>Resumo da compra</strong>: Exibe um resumo das compras durante o processo de finalização de compra.</li>\n<li><strong>Notificações do WooCommerce</strong>: Personalize a aparência e a funcionalidade das notificações do WooCommerce, como mensagens de confirmação de pedido.</li>\n</ol>\n<p>Crie sites profissionais com o <a href=\"https://go.elementor.com/wp-repo-description-tab-elementor-pro-elementor-pro/\" rel=\"nofollow ugc\">Elementor Pro</a>!</p>\n<h4>🔒 SEGURANÇA E CONFORMIDADE</h4>\n<p>O Elementor coloca um foco primordial na segurança, evidente através de nossa aquisição de certificações do setor, como ISO/IEC 27001, ISO/IEC 27017, ISO/IEC 27018, ISO/IEC 27701 e SOC 2 Tipo II. Essas certificações ressaltam nosso compromisso com a implementação de medidas de segurança robustas e destacam nossa dedicação em aderir a padrões reconhecidos do setor.</p>\n<p>Incentivamos a pesquisa ética de segurança através do nosso <a href=\"https://go.elementor.com/wp-repo-description-tab-bug-crowd-bug-bounty-program/\" rel=\"nofollow ugc\">Programa de recompensa por erros</a>. Colaboramos com os principais serviços de recompensa por erros para oferecer oportunidades aos pesquisadores de relatar vulnerabilidades em nossos serviços. Nossos programas de recompensas incluem uma equipe de triagem disponível 24 horas por dia, 7 dias por semana, 365 dias por ano.</p>\n<p>For more information: <a href=\"https://go.elementor.com/trust-center/\" rel=\"nofollow ugc\">Central de confiança</a>.</p>\n<h4>♿ Melhores práticas de acessibilidade</h4>\n<p>O Elementor oferece ferramentas e melhorias de acessibilidade para ajudá-lo a proporcionar uma experiência melhor para todos os usuários. Incluindo HTML 5 semântico, menu de navegação com teclado completo, melhoria contínua dos recursos, widget e muito mais.</p>\n<h4>🌐 Traduzido para mais de 63 idiomas, inclui compatibilidade com RTL</h4>\n<p>O Elementor oferece suporte a vários idiomas, tipografias e RTL (escrita da direita para a esquerda), com traduções do editor em <a href=\"https://go.elementor.com/wp-repo-description-tab-wordpress-plugin-translate/\" rel=\"nofollow ugc\">mais de 63 idiomas</a>. Também é compatível com WPML, Polylang, TranslatePress, Weglot e outros. Para contribuir, adicione um novo idioma em translate.wordpress.org. Consulte nosso guia sobre <a href=\"https://go.elementor.com/wp-repo-description-tab-help-center-translate/\" rel=\"nofollow ugc\">como traduzir e localizar o plugin</a>.</p>\n<h4>⏩ Uso de serviços de terceiros </h4>\n<p>Para melhorar a experiência do usuário, o Elementor pode usar os seguintes serviços de terceiros se o recurso exigido estiver ativado:</p>\n<ul>\n<li>Fontes do Google &#8211; são carregadas para adicionar fontes adicionais ao seu site. Consulte <a href=\"https://policies.google.com/terms\" rel=\"nofollow ugc\">TERMOS DE USO</a> e a <a href=\"https://policies.google.com/privacy\" rel=\"nofollow ugc\">Política de privacidade</a> do Google.</li>\n<li>Alguns recursos do Elementor exigem o carregamento de ativos do Elementor.com. Esses ativos não são usados para rastreamento, a menos que sejam explicitamente mencionados, exigindo sua aprovação e aceitação manual. Saiba mais em nossos <a href=\"https://go.elementor.com/wp-repo-description-tab-elementor-plugin-terms/\" rel=\"nofollow ugc\">Termos de serviço</a> e <<a href=\"https://go.elementor.com/wp-repo-description-tab-elementor-plugin-privacy/\" rel=\"nofollow ugc\">Política de privacidade</a>.</li>\n</ul>\n<h4>🌍 Participe de uma comunidade global</h4>\n<p>Participe de uma comunidade global, que se ajudam mutuamente a atingir seus objetivos.</p>\n<ul>\n<li><a href=\"https://go.elementor.com/wp-repo-description-tab-facebook-group/\" rel=\"nofollow ugc\">Comunidade do Facebook</a> &#8211; Mais de 150 mil membros, oferecendo suporte, conselhos, feedback e tutoriais.</li>\n<li><a href=\"https://go.elementor.com/wp-repo-description-tab-github-repo/\" rel=\"nofollow ugc\">Comunidade do GitHub</a> &#8211; Receba informações sobre versões, solicite recursos ou relate um erro.</li>\n<li><a href=\"https://go.elementor.com/wp-repo-description-tab-addons-dozens-of-elementor-addons/\" rel=\"nofollow ugc\">Complementos, temas e kits do Elementor</a> Temas e kits &#8211; criados especificamente para o Elementor.</li>\n<li>Aprenda insights e técnicas valiosas em nosso <a href=\"https://go.elementor.com/wp-repo-description-tab-youtube-channel/\" rel=\"nofollow ugc\">canal do YouTube</a>.</li>\n<li>Acesse nossa <a href=\"https://go.elementor.com/wp-repo-description-tab-academy-elementor-academy/\" rel=\"nofollow ugc\">Academia</a> e <a href=\"https://go.elementor.com/wp-repo-description-tab-help-center-help-center/\" rel=\"nofollow ugc\">Central de ajuda</a> &#8211; Encontre guias, tutoriais e recursos para responder às suas perguntas e aumentar a criatividade.</li>\n<li>Demonstre seu apoio <a href=\"https://go.elementor.com/wp-repo-description-tab-wordpress-plugin-review/\" rel=\"nofollow ugc\">nos classificando no WordPress</a>. Seu feedback estimula nosso crescimento! 🤗</li>\n<li>Se você tiver dúvidas ou precisar de suporte, acesse o <a href=\"https://go.elementor.com/wp-repo-description-tab-wordpress-plugin-forum/\" rel=\"nofollow ugc\">Fórum do plugin</a>. Os usuários do Elementor Pro podem receber suporte premium 24 horas por dia, 7 dias por semana, ou acessar o <a href=\"https://go.elementor.com/wp-repo-description-tab-homepage-elementor-website-builder/\" rel=\"nofollow ugc\">Construtor de sites Elementor</a>.</li>\n</ul>\n\";s:12:\"installation\";s:1676:\"<h4>Requisitos mínimos</h4>\n<ul>\n<li>WordPress 6.0 ou superior</li>\n<li>Versão do PHP 7.4 ou superior</li>\n<li>Versão do MySQL 5.0 ou superior</li>\n</ul>\n<h4>Requisitos recomendados</h4>\n<ul>\n<li>Versão do PHP 8.1 ou superior</li>\n<li>Versão do MySQL 5.6 ou superior</li>\n<li>Limite de memória do WordPress de 64 MB ou mais (preferencialmente 128 MB ou superior)</li>\n</ul>\n<p><span class=\"embed-youtube\" style=\"text-align:center; display: block;\"><iframe loading=\"lazy\" class=\"youtube-player\" width=\"750\" height=\"422\" src=\"https://www.youtube.com/embed/9EZ159ryFNs?version=3&#038;rel=1&#038;showsearch=0&#038;showinfo=1&#038;iv_load_policy=1&#038;fs=1&#038;hl=pt-BR&#038;autohide=2&#038;wmode=transparent\" allowfullscreen=\"true\" style=\"border:0;\" sandbox=\"allow-scripts allow-same-origin allow-popups allow-presentation allow-popups-to-escape-sandbox\"></iframe></span></p>\n<h4>Instalação</h4>\n<ol>\n<li>Instale usando o instalador de plugin integrado do WordPress ou extraia o arquivo zip e coloque o conteúdo no diretório <code>wp-content/plugins/</code> da sua instalação do WordPress.</li>\n<li>Ative o plugin através do menu &#8220;Plugins&#8221; no WordPress.</li>\n<li>Vá para Páginas > Adicionar nova</li>\n<li>Pressione o botão &#8220;Editar com o Elementor&#8221;.</li>\n<li>Agora você pode arrastar e soltar widgets do painel esquerdo para a área de conteúdo, bem como adicionar novas seções e colunas que compõem a estrutura da página.</li>\n</ol>\n<p>Para documentação e tutoriais, acesse nossa <a href=\"https://elementor.com/help/?utm_source=wp-repo&amp;utm_medium=link&amp;utm_campaign=readme\" rel=\"nofollow ugc\">Base de conhecimento</a>.</p>\n\";s:3:\"faq\";s:5272:\"\n<dt id=\'how%20do%20i%20install%20elementor%3F\'>\nComo faço para instalar o Elementor?\n</h4>\n<p>\n<p>Para instalar a versão gratuita do Elementor, siga os passos abaixo:<br />\nNo painel do WordPress -> Vá para Plugins -> Clique em &#8220;Adicionar novo&#8221; -> No campo de pesquisa, digite Elementor e escolha Elementor Website Builder.<br />\nPressione instalar -> Após a instalação, clique em &#8220;Ativar&#8221;.</p>\n</p>\n<dt id=\'does%20elementor%20work%20with%20all%20the%20themes%3F\'>\nO Elementor funciona com todos os temas?\n</h4>\n<p>\n<p>O Elementor funciona com todos os temas que respeitam os padrões de codificação do WordPress estabelecidos pelo seu Codex. É recomendável usar o <a href=\"https://go.elementor.com/wp-repo-description-tab-hello-theme-hello-theme/\" rel=\"nofollow ugc\">Tema Hello</a> do Elementor, uma tela em branco leve, para aproveitar da total flexibilidade ao usar o Elementor e otimizar sua experiência.</p>\n</p>\n<dt id=\'is%20elementor%20compatible%20with%20gutenberg%3F\'>\nO Elementor é compatível com o Gutenberg?\n</h4>\n<p>\n<p>O Elementor e o Gutenberg funcionam perfeitamente juntos. Como usuário, você pode decidir facilmente qual editor usar em cada ponto da edição do seu site.</p>\n</p>\n<dt id=\'can%20i%20create%20an%20online%20store%3F\'>\nPosso criar uma loja on-line?\n</h4>\n<p>\n<p>Sim, com o Elementor Pro WooCommerce Builder, você pode personalizar cada página da sua loja virtual para criar uma incrível experiência aos clientes que irá impulsionar as vendas.</p>\n</p>\n<dt id=\'does%20it%20work%20with%20other%20wordpress%20plugins%3F\'>\nFunciona com outros plugins do WordPress?\n</h4>\n<p>\n<p>Ele funciona com quase todos os plugins. Se você encontrar um problema de incompatibilidade, nos informe e também ao plugin que está em conflito com o Elementor.</p>\n</p>\n<dt id=\'do%20i%20need%20to%20know%20how%20to%20code%3F\'>\nPreciso saber programar?\n</h4>\n<p>\n<p>Não! O Elementor fornece todos os widgets e recursos que você precisa para criar um site profissional sem usar código.</p>\n</p>\n<dt id=\'do%20i%20need%20to%20know%20how%20to%20design%3F\'>\nPreciso saber sobre design?\n</h4>\n<p>\n<p>Não, você pode escolher entre kits e modelos desenvolvidos profissionalmente, que se adaptam a todos os segmentos e têm tudo o que você precisa para criar seu próprio site profissional.</p>\n</p>\n<dt id=\'will%20elementor%20slow%20down%20my%20website%3F\'>\nO Elementor vai deixar meu site mais lento?\n</h4>\n<p>\n<p>Como o Elementor prioriza velocidade e desempenho, você desfruta de melhorias de desempenho a cada nova versão. Ao testar o mesmo layout de página em versões antigas, você pode observar uma melhoria significativa no desempenho, de uma pontuação de 82 no Google PageSpeed Insight na versão 3.1 para uma pontuação de 95 na versão 3.5.</p>\n</p>\n<dt id=\'is%20my%20site%20secure%20with%20elementor%3F\'>\nMeu site é seguro com o Elementor?\n</h4>\n<p>\n<p>A segurança do seu site é extremamente importante para nós, e tomamos medidas proativas para garantir que seus sites sejam seguros. O Elementor é certificado pelo ISO 27001 e possui uma equipe dedicada de profissionais de segurança que implementa as melhores práticas do setor para máxima segurança e conformidade, 24 horas por dia, 7 dias por semana.</p>\n<p>Também há um programa gerenciado de segurança de recompensa por erros, utilizando o poder da comunidade ao ativar a detecção de vulnerabilidades 24 horas por dia, 7 dias por semana, durante todo o ano.</p>\n</p>\n<dt id=\'can%20i%20buy%20templates%20separately%3F\'>\nPosso comprar modelos separadamente?\n</h4>\n<p>\n<p>Claro, você pode usar qualquer modelo que seja compatível com o Elementor.</p>\n</p>\n<dt id=\'is%20elementor%20compatible%20with%20post%20and%20custom%20post%20types%3F\'>\nO Elementor é compatível com posts e tipos de post personalizados?\n</h4>\n<p>\n<p>Claro que sim! Você pode definir quais tipos de post irão ativar o Elementor na página de configurações.</p>\n</p>\n<dt id=\'what%20is%20the%20difference%20between%20elementor%27s%20free%20plugin%20and%20elementor%20pro\'>\nQual é a diferença entre o Plugin gratuito do Elementor e o Elementor Pro\n</h4>\n<p>\n<p>A versão gratuita do Elementor permite explorar nosso revolucionário editor visual de arrastar e soltar, além de oferecer widgets básicos e modelos. O Elementor Pro (Essential, Advanced, Expert, Studio e Agency) proporciona ferramentas mais profissionais que aceleram seu fluxo de trabalho, oferecem acesso a suporte humano, ajudam a criar conteúdo mais avançado e a converter visitantes. Veja a comparação completa aqui.</p>\n</p>\n<dt id=\'how%20can%20i%20become%20a%20contributor\'>\nComo posso me tornar um colaborador\n</h4>\n<p>\n<p>Se quiser contribuir, acesse nosso <a href=\"https://github.com/elementor/elementor\" rel=\"nofollow ugc\">Repositório GitHub do Elementor</a> e veja como pode ajudar.<br />\nTambém é possível adicionar um novo idioma pelo site <a href=\"https://go.elementor.com/wp-repo-description-tab-wordpress-plugin-translate/\" rel=\"nofollow ugc\">translate.wordpress.org</a>. Criamos um pequeno guia explicando <a href=\"https://go.elementor.com/wp-repo-description-tab-wordpress-plugin-translate-faq/\" rel=\"nofollow ugc\">como traduzir e localizar o plugin</a>.</p>\n</p>\n\n\";s:9:\"changelog\";s:4302:\"<h4>3.23.4 &#8211; 2024-08-05</h4>\n<ul>\n<li>Correção: Os links para as configurações do Elementor estavam quebrados em vários locais</li>\n</ul>\n<h4>3.23.3 &#8211; 2024-07-25</h4>\n<ul>\n<li>Correção: Correções na interface do usuário para melhorar a experiência do usuário</li>\n</ul>\n<h4>3.23.2 &#8211; 2024-07-23</h4>\n<ul>\n<li>Correção de segurança: Melhorada a aplicação da segurança do código no URL do link</li>\n<li>Correção: O nome de usuário do Facebook Messenger não estava funcionando em dispositivos móveis com botões flutuantes (<a href=\"https://github.com/elementor/elementor/issues/28103\" rel=\"nofollow ugc\">#28103</a>)</li>\n<li>Correção: Problemas no RTL com modelos de botões flutuantes</li>\n<li>Correção: O WordPress 6.6 não era compatível com determinados recursos</li>\n</ul>\n<h4>3.23.1 &#8211; 2024-07-15</h4>\n<ul>\n<li>Correção: Carregamento lento das telas administrativas do WordPress e do Elementor devido à verificação de integridade da IA</li>\n</ul>\n<h4>3.23.0 &#8211; 2024-07-15</h4>\n<ul>\n<li>Novo: Aumente o envolvimento com os botões flutuantes &#8211; Converta visitantes em leads, tornando mais fácil do que nunca iniciar uma conversa em qualquer plataforma</li>\n<li>Novo: Introduzido o link na biografia &#8211; permitindo que você crie um cartão de visita digital e o compartilhe com facilidade</li>\n<li>Novo: Gerar imagem destacada com IA</li>\n<li>Novo: Gerar textos usando IA no WordPress</li>\n<li>Ajuste: Adicionado suporte para a propriedade CSS <code>overscroll-behavior</code> para melhorar a experiência de rolagem</li>\n<li>Ajuste: Ativação do recurso da barra superior do editor como padrão para novos sites</li>\n<li>Ajuste: Ativado o recurso de armazenamento em cache de elementos para novos sites e promovido ao status &#8220;Beta&#8221;.</li>\n<li>Ajuste: Promoção do recurso &#8220;Carregamento lento de imagens de fundo&#8221; para o status &#8220;Estável&#8221;.</li>\n<li>Ajuste: Oculte a &#8220;Visualização padrão do dispositivo&#8221; nas preferências do usuário quando a barra superior do editor estiver ativa</li>\n<li>Ajuste: Aumento da altura do popover global para melhorar a usabilidade</li>\n<li>Ajuste: Melhoradas as predefinições de estilo de imagem e adição de duas predefinições adicionais em imagens com IA</li>\n<li>Ajuste: Adicionada a opção de geração de resumo com IA no editor</li>\n<li>Correção: Problemas de desempenho que causavam atraso e lentidão durante a edição de elementos aninhados (<a href=\"https://github.com/elementor/elementor/issues/24076\" rel=\"nofollow ugc\">#24076</a>)</li>\n<li>Correção: Problemas com a reprodução automática de vídeos em vários cenários (agradecimentos a <a href=\"https://github.com/JxxIT\" rel=\"nofollow ugc\">@JxxIT</a>, <a href=\"https://github.com/elementor/elementor/issues/24324\" rel=\"nofollow ugc\">#24324</a>, <a href=\"https://github.com/elementor/elementor/issues/14437\" rel=\"nofollow ugc\">#14437</a>, <a href=\"https://github.com/elementor/elementor/issues/7964\" rel=\"nofollow ugc\">#7964</a>)</li>\n<li>Correção: Problemas nas permissões de gravação relacionados ao diretório raiz do WordPress (<a href=\"https://github.com/elementor/elementor/issues/21036\" rel=\"nofollow ugc\">#21036</a>, <a href=\"https://github.com/elementor/elementor/issues/17255\" rel=\"nofollow ugc\">#17255</a>)</li>\n<li>Correção: Restauração de fontes do Google obsoletas que ficaram obsoletas na atualização anterior (<a href=\"https://github.com/elementor/elementor/issues/27701\" rel=\"nofollow ugc\">#27701</a>)</li>\n<li>Correção: A estrutura de links do Vimeo com hash de privacidade não estava funcionando corretamente com a ação de link dinâmico usando a lightbox</li>\n<li>Correção: Validação das alterações no prompt e na tela para permitir a geração no preenchimento generativo da edição de imagem com IA</li>\n<li>Correção: As versões dos arquivos básicos do Elementor estavam sendo adicionadas incorretamente ao histórico de versões do Elementor Pro</li>\n<li>Correção: O AI Connect não estava sendo iniciado quando o usuário não tinha dados de conexão anteriores</li>\n</ul>\n<p><a href=\"https://go.elementor.com/full-changelog/\" rel=\"nofollow ugc\">Consulte o registro de alterações para todas as versões.</a></p>\n\";s:11:\"screenshots\";s:3515:\"<ol><li><a href=\"https://ps.w.org/elementor/assets/screenshot-1.gif?rev=3005087\"><img src=\"https://ps.w.org/elementor/assets/screenshot-1.gif?rev=3005087\" alt=\"&lt;strong&gt;Editor visual de arrastar e soltar&lt;/strong&gt; - Projete e crie os layouts do seu site e coloque qualquer elemento em qualquer lugar da página para obter designs perfeitos em pixels.\"></a><p><strong>Editor visual de arrastar e soltar</strong> - Projete e crie os layouts do seu site e coloque qualquer elemento em qualquer lugar da página para obter designs perfeitos em pixels.</p></li><li><a href=\"https://ps.w.org/elementor/assets/screenshot-2.gif?rev=3005087\"><img src=\"https://ps.w.org/elementor/assets/screenshot-2.gif?rev=3005087\" alt=\"&lt;strong&gt;Sistema de design completo&lt;/strong&gt; - Tenha um fluxo de trabalho profissional e garanta consistência em todo o seu site. Defina suas configurações, use-as globalmente e ajuste-as instantaneamente a qualquer momento.\"></a><p><strong>Sistema de design completo</strong> - Tenha um fluxo de trabalho profissional e garanta consistência em todo o seu site. Defina suas configurações, use-as globalmente e ajuste-as instantaneamente a qualquer momento.</p></li><li><a href=\"https://ps.w.org/elementor/assets/screenshot-3.gif?rev=3005087\"><img src=\"https://ps.w.org/elementor/assets/screenshot-3.gif?rev=3005087\" alt=\"&lt;strong&gt;Design responsivo&lt;/strong&gt; - Edite totalmente o seu site e personalize o comportamento em desktop, tablet e dispositivos móveis para otimizar a experiência do visitante em todos os dispositivos.\"></a><p><strong>Design responsivo</strong> - Edite totalmente o seu site e personalize o comportamento em desktop, tablet e dispositivos móveis para otimizar a experiência do visitante em todos os dispositivos.</p></li><li><a href=\"https://ps.w.org/elementor/assets/screenshot-4.gif?rev=3005087\"><img src=\"https://ps.w.org/elementor/assets/screenshot-4.gif?rev=3005087\" alt=\"&lt;strong&gt;Kits e modelos&lt;/strong&gt; - Inicie rapidamente o seu processo de criação de sites ou se inspire com modelos projetados profissionalmente ou kits completos de sites disponíveis para personalização imediata.\"></a><p><strong>Kits e modelos</strong> - Inicie rapidamente o seu processo de criação de sites ou se inspire com modelos projetados profissionalmente ou kits completos de sites disponíveis para personalização imediata.</p></li><li><a href=\"https://ps.w.org/elementor/assets/screenshot-5.gif?rev=3005087\"><img src=\"https://ps.w.org/elementor/assets/screenshot-5.gif?rev=3005087\" alt=\"&lt;strong&gt;Elementos aninhados&lt;/strong&gt; - Aproveite os widgets aninhados do Elementor para colocar qualquer widget dentro da área de conteúdo de outro widget, como abas e sanfonas, para total flexibilidade de design.\"></a><p><strong>Elementos aninhados</strong> - Aproveite os widgets aninhados do Elementor para colocar qualquer widget dentro da área de conteúdo de outro widget, como abas e sanfonas, para total flexibilidade de design.</p></li><li><a href=\"https://ps.w.org/elementor/assets/screenshot-6.gif?rev=3005087\"><img src=\"https://ps.w.org/elementor/assets/screenshot-6.gif?rev=3005087\" alt=\"&lt;strong&gt;Efeitos de movimento&lt;/strong&gt; - Adicione animações de entrada e transições a qualquer elemento do seu site para cativar os visitantes.\"></a><p><strong>Efeitos de movimento</strong> - Adicione animações de entrada e transições a qualquer elemento do seu site para cativar os visitantes.</p></li></ol>\";s:7:\"reviews\";s:18097:\"<div class=\"review\">\n	<div class=\"review-head\">\n		<div class=\"reviewer-info\">\n			<div class=\"review-title-section\">\n				<h4 class=\"review-title\">A Wonderful Experience</h4>\n				<div class=\"star-rating\">\n				<div class=\"wporg-ratings\" aria-label=\"5 de 5 estrelas\" data-title-template=\"%s de 5 estrelas\" data-rating=\"5\" style=\"color:#ffb900;\"><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-filled\"></span></div>				</div>\n			</div>\n			<p class=\"reviewer\">\n				Por <a href=\"https://profiles.wordpress.org/hyeyoga/\"><img alt=\'\' src=\'https://secure.gravatar.com/avatar/7e3589382e78a109c70c104f0d322431?s=16&#038;d=monsterid&#038;r=g\' srcset=\'https://secure.gravatar.com/avatar/7e3589382e78a109c70c104f0d322431?s=32&#038;d=monsterid&#038;r=g 2x\' class=\'avatar avatar-16 photo\' height=\'16\' width=\'16\' loading=\'lazy\' decoding=\'async\'/></a><a href=\"https://profiles.wordpress.org/hyeyoga/\" class=\"reviewer-name\">hyeyoga</a> em <span class=\"review-date\">agosto 15, 2024</span>			</p>\n		</div>\n	</div>\n	<div class=\"review-body\"><!-- wp:paragraph -->\n<p>⭐️⭐️⭐️⭐️⭐️ Elementor is an incredibly user-friendly plugin with a beautiful interface. As a beginner, I found it extremely convenient to use, making website customization a breeze!</p>\n<!-- /wp:paragraph --></div>\n</div>\n<div class=\"review\">\n	<div class=\"review-head\">\n		<div class=\"reviewer-info\">\n			<div class=\"review-title-section\">\n				<h4 class=\"review-title\">Love Elementor</h4>\n				<div class=\"star-rating\">\n				<div class=\"wporg-ratings\" aria-label=\"5 de 5 estrelas\" data-title-template=\"%s de 5 estrelas\" data-rating=\"5\" style=\"color:#ffb900;\"><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-filled\"></span></div>				</div>\n			</div>\n			<p class=\"reviewer\">\n				Por <a href=\"https://profiles.wordpress.org/andybarn56/\"><img alt=\'\' src=\'https://secure.gravatar.com/avatar/05d23b88f4adc8af202f470bb014adba?s=16&#038;d=monsterid&#038;r=g\' srcset=\'https://secure.gravatar.com/avatar/05d23b88f4adc8af202f470bb014adba?s=32&#038;d=monsterid&#038;r=g 2x\' class=\'avatar avatar-16 photo\' height=\'16\' width=\'16\' loading=\'lazy\' decoding=\'async\'/></a><a href=\"https://profiles.wordpress.org/andybarn56/\" class=\"reviewer-name\">andybarn56</a> em <span class=\"review-date\">agosto 9, 2024</span>			</p>\n		</div>\n	</div>\n	<div class=\"review-body\"><!-- wp:paragraph -->\n<p>I started using Elementor back in 2019 when I was evaluating different Page Builders. I am so delighted I chose Elementor as it has gone from strength to strength and continues to evolve and add new features and functionality. I upgraded to the Pro version and just love this plugin!!</p>\n<!-- /wp:paragraph --></div>\n</div>\n<div class=\"review\">\n	<div class=\"review-head\">\n		<div class=\"reviewer-info\">\n			<div class=\"review-title-section\">\n				<h4 class=\"review-title\">ELEMENTOR CUSTOMER SERVICE SUCKS!!!</h4>\n				<div class=\"star-rating\">\n				<div class=\"wporg-ratings\" aria-label=\"1 de 5 estrelas\" data-title-template=\"%s de 5 estrelas\" data-rating=\"1\" style=\"color:#ffb900;\"><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-empty\"></span><span class=\"star dashicons dashicons-star-empty\"></span><span class=\"star dashicons dashicons-star-empty\"></span><span class=\"star dashicons dashicons-star-empty\"></span></div>				</div>\n			</div>\n			<p class=\"reviewer\">\n				Por <a href=\"https://profiles.wordpress.org/ga403b/\"><img alt=\'\' src=\'https://secure.gravatar.com/avatar/ace0d9dcb69446d85cd5ff6d4ea5eb58?s=16&#038;d=monsterid&#038;r=g\' srcset=\'https://secure.gravatar.com/avatar/ace0d9dcb69446d85cd5ff6d4ea5eb58?s=32&#038;d=monsterid&#038;r=g 2x\' class=\'avatar avatar-16 photo\' height=\'16\' width=\'16\' loading=\'lazy\' decoding=\'async\'/></a><a href=\"https://profiles.wordpress.org/ga403b/\" class=\"reviewer-name\">ga403b</a> em <span class=\"review-date\">agosto 8, 2024</span>			</p>\n		</div>\n	</div>\n	<div class=\"review-body\"><!-- wp:paragraph -->\n<p>Purchased an image optimizer plan which was basically implied that it was needed, to operate with the standard Elementor plugin which we already pay for. We use this to design our Wordpress website which the Elementor Plugin is very buggy in that regard. The FREE image optimizer offers up to 5,000 images to be optimized which we have. The plugin stated we had exceeded our quota, so we elected to upgrade for a 5,000+ photo plan for $50. Plugin wouldn\'t work and still stated we were over quota. Something seemed skechy, but okay. We went ahead and purchased the next package which is the 20,000 photo plan for another $50. Again, wouldn\'t work. Contacted technical support after going round and round with their Auto BOT for about 10 minutes. Guess it just wanted to refuse me in speaking with someone? Think that was intentional but moving forward…finally spoke to someone and they said they would take a look and to download their \"Temporary Login\" plugin. Did that, granted them access, and they said they couldn\'t get into our site and to reset it and then grant access again. Did that and they still couldn\'t get in. At this time we\'ve got about an hour invested in this crap show and said just cancel our subscription plan and provide a refund. All of our images are already optimized using the WebP extension. \"Oh, we\'re sorry but our products are non-refundable!\" Okay, I\'ll call my bank to dispute the charges for a product that failed to work for me and I\'ll go ahead and also leave you 1-star reviews everywhere I can, to advise others of your shady business practice. That threat didn\'t seem to change their tune so here I am. REVIEW LEFT AND FUNDS ARE NOW BACK IN MY ACCOUNT AFTER CALLING MY FINANCIAL INSTITUTION AND TELLING THEM OF THEIR BUSINESS PRACTICES!</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>SHAME ON YOU! You can do better!</p>\n<!-- /wp:paragraph --></div>\n</div>\n<div class=\"review\">\n	<div class=\"review-head\">\n		<div class=\"reviewer-info\">\n			<div class=\"review-title-section\">\n				<h4 class=\"review-title\">Elementor is now a bloated disaster</h4>\n				<div class=\"star-rating\">\n				<div class=\"wporg-ratings\" aria-label=\"1 de 5 estrelas\" data-title-template=\"%s de 5 estrelas\" data-rating=\"1\" style=\"color:#ffb900;\"><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-empty\"></span><span class=\"star dashicons dashicons-star-empty\"></span><span class=\"star dashicons dashicons-star-empty\"></span><span class=\"star dashicons dashicons-star-empty\"></span></div>				</div>\n			</div>\n			<p class=\"reviewer\">\n				Por <a href=\"https://profiles.wordpress.org/dividendninja/\"><img alt=\'\' src=\'https://secure.gravatar.com/avatar/b1c134a84aceffa2d11f604b905f4f22?s=16&#038;d=monsterid&#038;r=g\' srcset=\'https://secure.gravatar.com/avatar/b1c134a84aceffa2d11f604b905f4f22?s=32&#038;d=monsterid&#038;r=g 2x\' class=\'avatar avatar-16 photo\' height=\'16\' width=\'16\' loading=\'lazy\' decoding=\'async\'/></a><a href=\"https://profiles.wordpress.org/dividendninja/\" class=\"reviewer-name\">Avrom <small>(dividendninja)</small></a> em <span class=\"review-date\">agosto 6, 2024</span>			</p>\n		</div>\n	</div>\n	<div class=\"review-body\"><!-- wp:paragraph -->\n<p>Elementor used to be great, even the free version. It was our favorite page builder. Now it is a bloated disaster with changes that have made it become worse and worse - to the point of being unusable. First was the Pepto Bismol pink UI elements (my least favorite color). Thanx for that. Secondly, you removed inner-sections which is what made Elementor so easy to use. Your new Grid and Flex-Box have no bearing on website reality, and make life incredibly difficult for designers and developers of all abilities. I can\'t even layout anything in this editor anymore - what a complete mess!!<br /><br />Remember, the whole idea of a page builder is to make things easy for people to use - not more complicated as you have done!! Moving forward, we will not use Elementor on any new sites and will look at other alternatives - even Gutenberg if we have to. And will consider recoding our own sites to move them off Elementor as we can. </p>\n<!-- /wp:paragraph --></div>\n</div>\n<div class=\"review\">\n	<div class=\"review-head\">\n		<div class=\"reviewer-info\">\n			<div class=\"review-title-section\">\n				<h4 class=\"review-title\">elementor现在有点太大了，不好</h4>\n				<div class=\"star-rating\">\n				<div class=\"wporg-ratings\" aria-label=\"4 de 5 estrelas\" data-title-template=\"%s de 5 estrelas\" data-rating=\"4\" style=\"color:#ffb900;\"><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-empty\"></span></div>				</div>\n			</div>\n			<p class=\"reviewer\">\n				Por <a href=\"https://profiles.wordpress.org/mu12zi/\"><img alt=\'\' src=\'https://secure.gravatar.com/avatar/44dd1cc720190c698a939fa3de67d662?s=16&#038;d=monsterid&#038;r=g\' srcset=\'https://secure.gravatar.com/avatar/44dd1cc720190c698a939fa3de67d662?s=32&#038;d=monsterid&#038;r=g 2x\' class=\'avatar avatar-16 photo\' height=\'16\' width=\'16\' loading=\'lazy\' decoding=\'async\'/></a><a href=\"https://profiles.wordpress.org/mu12zi/\" class=\"reviewer-name\">mu12zi</a> em <span class=\"review-date\">agosto 6, 2024</span>			</p>\n		</div>\n	</div>\n	<div class=\"review-body\"><!-- wp:paragraph -->\n<p>希望可以更轻快，更全面，更简单，现在代码需要优化</p>\n<!-- /wp:paragraph --></div>\n</div>\n<div class=\"review\">\n	<div class=\"review-head\">\n		<div class=\"reviewer-info\">\n			<div class=\"review-title-section\">\n				<h4 class=\"review-title\">Does what we need and more</h4>\n				<div class=\"star-rating\">\n				<div class=\"wporg-ratings\" aria-label=\"5 de 5 estrelas\" data-title-template=\"%s de 5 estrelas\" data-rating=\"5\" style=\"color:#ffb900;\"><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-filled\"></span></div>				</div>\n			</div>\n			<p class=\"reviewer\">\n				Por <a href=\"https://profiles.wordpress.org/apatonsmith/\"><img alt=\'\' src=\'https://secure.gravatar.com/avatar/e7efbdeffcf360ab8c876b8887701ea3?s=16&#038;d=monsterid&#038;r=g\' srcset=\'https://secure.gravatar.com/avatar/e7efbdeffcf360ab8c876b8887701ea3?s=32&#038;d=monsterid&#038;r=g 2x\' class=\'avatar avatar-16 photo\' height=\'16\' width=\'16\' loading=\'lazy\' decoding=\'async\'/></a><a href=\"https://profiles.wordpress.org/apatonsmith/\" class=\"reviewer-name\">apatonsmith</a> em <span class=\"review-date\">agosto 4, 2024</span>			</p>\n		</div>\n	</div>\n	<div class=\"review-body\"><!-- wp:paragraph -->\n<p>Exactly what we need and more - highly recommended</p>\n<!-- /wp:paragraph --></div>\n</div>\n<div class=\"review\">\n	<div class=\"review-head\">\n		<div class=\"reviewer-info\">\n			<div class=\"review-title-section\">\n				<h4 class=\"review-title\">Fix Performanse pages</h4>\n				<div class=\"star-rating\">\n				<div class=\"wporg-ratings\" aria-label=\"3 de 5 estrelas\" data-title-template=\"%s de 5 estrelas\" data-rating=\"3\" style=\"color:#ffb900;\"><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-empty\"></span><span class=\"star dashicons dashicons-star-empty\"></span></div>				</div>\n			</div>\n			<p class=\"reviewer\">\n				Por <a href=\"https://profiles.wordpress.org/sceko/\"><img alt=\'\' src=\'https://secure.gravatar.com/avatar/986a4972d8b2c70da1915f9fc806acbf?s=16&#038;d=monsterid&#038;r=g\' srcset=\'https://secure.gravatar.com/avatar/986a4972d8b2c70da1915f9fc806acbf?s=32&#038;d=monsterid&#038;r=g 2x\' class=\'avatar avatar-16 photo\' height=\'16\' width=\'16\' loading=\'lazy\' decoding=\'async\'/></a><a href=\"https://profiles.wordpress.org/sceko/\" class=\"reviewer-name\">Sceko</a> em <span class=\"review-date\">agosto 4, 2024</span>			</p>\n		</div>\n	</div>\n	<div class=\"review-body\"><!-- wp:paragraph -->\n<p>Correct on the page wp-admin/admin.php?page=elementor-settings#tab-performance<br />You made everything a link, but you forgot to add &lt;/a&gt;</p>\n<!-- /wp:paragraph --></div>\n</div>\n<div class=\"review\">\n	<div class=\"review-head\">\n		<div class=\"reviewer-info\">\n			<div class=\"review-title-section\">\n				<h4 class=\"review-title\">the best</h4>\n				<div class=\"star-rating\">\n				<div class=\"wporg-ratings\" aria-label=\"5 de 5 estrelas\" data-title-template=\"%s de 5 estrelas\" data-rating=\"5\" style=\"color:#ffb900;\"><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-filled\"></span></div>				</div>\n			</div>\n			<p class=\"reviewer\">\n				Por <a href=\"https://profiles.wordpress.org/sidata/\"><img alt=\'\' src=\'https://secure.gravatar.com/avatar/f86ef8625450f517970be87f2bccd1ec?s=16&#038;d=monsterid&#038;r=g\' srcset=\'https://secure.gravatar.com/avatar/f86ef8625450f517970be87f2bccd1ec?s=32&#038;d=monsterid&#038;r=g 2x\' class=\'avatar avatar-16 photo\' height=\'16\' width=\'16\' loading=\'lazy\' decoding=\'async\'/></a><a href=\"https://profiles.wordpress.org/sidata/\" class=\"reviewer-name\">SIDATA <small>(sidata)</small></a> em <span class=\"review-date\">agosto 1, 2024</span>			</p>\n		</div>\n	</div>\n	<div class=\"review-body\"><!-- wp:paragraph -->\n<p>I like Elementor; it\'s the best on the market. One major wish would be to improve its speed and reduce the code a bit.</p>\n<!-- /wp:paragraph --></div>\n</div>\n<div class=\"review\">\n	<div class=\"review-head\">\n		<div class=\"reviewer-info\">\n			<div class=\"review-title-section\">\n				<h4 class=\"review-title\">Marvelous</h4>\n				<div class=\"star-rating\">\n				<div class=\"wporg-ratings\" aria-label=\"5 de 5 estrelas\" data-title-template=\"%s de 5 estrelas\" data-rating=\"5\" style=\"color:#ffb900;\"><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-filled\"></span></div>				</div>\n			</div>\n			<p class=\"reviewer\">\n				Por <a href=\"https://profiles.wordpress.org/wesqom/\"><img alt=\'\' src=\'https://secure.gravatar.com/avatar/55f81f37bccb897b37e30a93835c27b6?s=16&#038;d=monsterid&#038;r=g\' srcset=\'https://secure.gravatar.com/avatar/55f81f37bccb897b37e30a93835c27b6?s=32&#038;d=monsterid&#038;r=g 2x\' class=\'avatar avatar-16 photo\' height=\'16\' width=\'16\' loading=\'lazy\' decoding=\'async\'/></a><a href=\"https://profiles.wordpress.org/wesqom/\" class=\"reviewer-name\">wesqom</a> em <span class=\"review-date\">julho 30, 2024</span>			</p>\n		</div>\n	</div>\n	<div class=\"review-body\"><!-- wp:paragraph -->\n<p>Very flexible</p>\n<!-- /wp:paragraph --></div>\n</div>\n<div class=\"review\">\n	<div class=\"review-head\">\n		<div class=\"reviewer-info\">\n			<div class=\"review-title-section\">\n				<h4 class=\"review-title\">Terrible support, buggy install and UI</h4>\n				<div class=\"star-rating\">\n				<div class=\"wporg-ratings\" aria-label=\"1 de 5 estrelas\" data-title-template=\"%s de 5 estrelas\" data-rating=\"1\" style=\"color:#ffb900;\"><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-empty\"></span><span class=\"star dashicons dashicons-star-empty\"></span><span class=\"star dashicons dashicons-star-empty\"></span><span class=\"star dashicons dashicons-star-empty\"></span></div>				</div>\n			</div>\n			<p class=\"reviewer\">\n				Por <a href=\"https://profiles.wordpress.org/dmed/\"><img alt=\'\' src=\'https://secure.gravatar.com/avatar/9bed78a3997322fa843ac714acc78588?s=16&#038;d=monsterid&#038;r=g\' srcset=\'https://secure.gravatar.com/avatar/9bed78a3997322fa843ac714acc78588?s=32&#038;d=monsterid&#038;r=g 2x\' class=\'avatar avatar-16 photo\' height=\'16\' width=\'16\' loading=\'lazy\' decoding=\'async\'/></a><a href=\"https://profiles.wordpress.org/dmed/\" class=\"reviewer-name\">Dmed <small>(dmed)</small></a> em <span class=\"review-date\">julho 29, 2024</span>			</p>\n		</div>\n	</div>\n	<div class=\"review-body\"><!-- wp:paragraph -->\n<p>Paid customer and they can barely provide support. Chat disconnects and you have to go through a virtual assistant dozens of times and then can\'t reconnect to the same issue. They don\'t even have options to track ticket numbers. </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Had issues with the account connection and thought it was a license issue. Since we couldn\'t reach support, we upgraded thinking it would solve the problem because we had dev/stg sites and it turns out we did not need to. They won\'t refund the upgrade cost or provide a credit for the cost. Now we are stuck on a higher cost plan or issuing a chargeback or losing the upgrade cost. Ridiculous! </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>This is all due to a support issue they created by not connecting the paid account correctly and providing clear instructions on what was causing the issue. The upgrade path needs to be very clear and Elementor fails horrendously. Would not recommend Elementor at this point. Get Beaver Builder, Divi or use the WP Block Editor. </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Just do a search for \"Elementor support nightmare\" and you\'ll find a load of unhappy customers. Sad really...</p>\n<!-- /wp:paragraph --></div>\n</div>\n\";}s:17:\"short_description\";s:198:\"O construtor de sites Elementor tem tudo: construtor de páginas do tipo arrastar e soltar, design perfeito em pixels, edição responsiva para dispositivos móveis e muito mais. Comece agora mesmo!\";s:13:\"download_link\";s:59:\"https://downloads.wordpress.org/plugin/elementor.3.23.4.zip\";s:14:\"upgrade_notice\";a:0:{}s:11:\"screenshots\";a:6:{i:1;a:2:{s:3:\"src\";s:62:\"https://ps.w.org/elementor/assets/screenshot-1.gif?rev=3005087\";s:7:\"caption\";s:188:\"<strong>Editor visual de arrastar e soltar</strong> - Projete e crie os layouts do seu site e coloque qualquer elemento em qualquer lugar da página para obter designs perfeitos em pixels.\";}i:2;a:2:{s:3:\"src\";s:62:\"https://ps.w.org/elementor/assets/screenshot-2.gif?rev=3005087\";s:7:\"caption\";s:226:\"<strong>Sistema de design completo</strong> - Tenha um fluxo de trabalho profissional e garanta consistência em todo o seu site. Defina suas configurações, use-as globalmente e ajuste-as instantaneamente a qualquer momento.\";}i:3;a:2:{s:3:\"src\";s:62:\"https://ps.w.org/elementor/assets/screenshot-3.gif?rev=3005087\";s:7:\"caption\";s:204:\"<strong>Design responsivo</strong> - Edite totalmente o seu site e personalize o comportamento em desktop, tablet e dispositivos móveis para otimizar a experiência do visitante em todos os dispositivos.\";}i:4;a:2:{s:3:\"src\";s:62:\"https://ps.w.org/elementor/assets/screenshot-4.gif?rev=3005087\";s:7:\"caption\";s:216:\"<strong>Kits e modelos</strong> - Inicie rapidamente o seu processo de criação de sites ou se inspire com modelos projetados profissionalmente ou kits completos de sites disponíveis para personalização imediata.\";}i:5;a:2:{s:3:\"src\";s:62:\"https://ps.w.org/elementor/assets/screenshot-5.gif?rev=3005087\";s:7:\"caption\";s:215:\"<strong>Elementos aninhados</strong> - Aproveite os widgets aninhados do Elementor para colocar qualquer widget dentro da área de conteúdo de outro widget, como abas e sanfonas,