=\"\" loading=\"lazy\" />		\n			<style>/*! elementor - v3.23.0 - 05-08-2024 */\n.elementor-heading-title{padding:0;margin:0;line-height:1}.elementor-widget-heading .elementor-heading-title[class*=elementor-size-]>a{color:inherit;font-size:inherit;line-height:inherit}.elementor-widget-heading .elementor-heading-title.elementor-size-small{font-size:15px}.elementor-widget-heading .elementor-heading-title.elementor-size-medium{font-size:19px}.elementor-widget-heading .elementor-heading-title.elementor-size-large{font-size:29px}.elementor-widget-heading .elementor-heading-title.elementor-size-xl{font-size:39px}.elementor-widget-heading .elementor-heading-title.elementor-size-xxl{font-size:59px}</style><h2>Participantes</h2>','Posts/Projetos','','publish','closed','closed','','posts-projetos','','','2024-08-15 15:39:26','2024-08-15 18:39:26','',0,'http://localhost/wordpress/?post_type=elementor_library&#038;p=30',0,'elementor_library','',0),(33,1,'2024-07-30 14:37:18','2024-07-30 17:37:18','<!-- wp:paragraph -->\n<p>A Universidade Federal de Santa Maria (UFSM) tem se destacado não apenas pela qualidade de seu ensino e pesquisa, mas também pelo impacto significativo de suas ações de extensão na comunidade. Recentemente, o projeto \"Saúde e Bem-Estar na Terceira Idade\" tem chamado a atenção pela sua abordagem inovadora e pelos resultados positivos alcançados.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Coordenado pela Professora Dr. Ana Maria Silva e pelo Professor Dr. João Carlos Pereira, o projeto visa promover a saúde e o bem-estar dos idosos na região de Santa Maria. Com uma equipe multidisciplinar composta por alunos de diferentes cursos, como Enfermagem, Educação Física, Psicologia e Nutrição, o projeto realiza atividades físicas adaptadas, palestras educativas sobre alimentação saudável e oficinas de integração social.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>A Professora Dr. Ana Maria Silva, do Departamento de Enfermagem, destaca a importância de ações que valorizem a experiência de vida dos idosos e proporcionem um ambiente acolhedor para que eles se sintam motivados a participar. Já o Professor Dr. João Carlos Pereira, do Departamento de Educação Física, enfatiza os benefícios das atividades físicas regulares na prevenção de doenças e na melhoria da qualidade de vida.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Além das atividades práticas, o projeto também realiza encontros semanais onde são discutidos temas como o envelhecimento ativo e os direitos dos idosos. Essas discussões são mediadas pela Professora Dr. Carla Mendes, do Departamento de Psicologia, que ressalta a importância de oferecer suporte emocional e psicológico aos participantes.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Os resultados do projeto têm sido extremamente positivos, com relatos de melhorias na saúde física e mental dos idosos participantes. A UFSM, através de suas ações de extensão, continua a fortalecer seu compromisso com a comunidade, promovendo iniciativas que fazem a diferença na vida das pessoas.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Para o futuro, a equipe coordenadora planeja expandir o projeto para outras regiões e incluir novas atividades, sempre com o objetivo de promover o bem-estar e a qualidade de vida na terceira idade.</p>\n<!-- /wp:paragraph -->','Saúde e Bem-Estar na Terceira Idade','','publish','open','open','','saude-e-bem-estar-na-terceira-idade','','','2024-08-13 17:18:08','2024-08-13 20:18:08','',0,'http://localhost/wordpress/?p=33',0,'post','',0),(34,1,'2024-07-30 14:37:04','2024-07-30 17:37:04','','imagem_2024-07-30_143703773','','inherit','open','closed','','imagem_2024-07-30_143703773','','','2024-07-30 14:37:04','2024-07-30 17:37:04','',33,'http://localhost/wordpress/wp-content/uploads/2024/07/imagem_2024-07-30_143703773.png',0,'attachment','image/png',0),(37,1,'2024-07-30 14:41:05','2024-07-30 17:41:05','','83fe59fc7d92f5fbf68a307b03a72af2','','inherit','open','closed','','83fe59fc7d92f5fbf68a307b03a72af2','','','2024-07-30 14:41:05','2024-07-30 17:41:05','',19,'http://localhost/wordpress/wp-content/uploads/2024/07/83fe59fc7d92f5fbf68a307b03a72af2-1.png',0,'attachment','image/png',0),(78,1,'2024-07-30 15:09:13','2024-07-30 18:09:13','<!-- wp:paragraph -->\n<p>A Universidade Federal de Santa Maria (UFSM) tem demonstrado seu compromisso com a sustentabilidade e o meio ambiente através de diversas ações de extensão voltadas para a reciclagem e a conscientização ambiental. Um exemplo notável é o projeto \"Reciclar para Preservar\", que tem se tornado um modelo de boas práticas na região.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Coordenado pelo Professor Dr. Ricardo Oliveira e pela Professora Dr. Mariana Ferreira, o projeto tem como objetivo principal promover a coleta seletiva e o correto descarte de resíduos na universidade e em comunidades próximas. Com a participação ativa de alunos de diversos cursos, como Engenharia Ambiental, Biologia, e Administração, o projeto realiza campanhas educativas, palestras, e oficinas práticas sobre reciclagem e sustentabilidade.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>O Professor Dr. Ricardo Oliveira, do Departamento de Engenharia Ambiental, explica que a conscientização é a chave para mudanças duradouras. \"Não basta apenas oferecer locais de coleta, é preciso educar a comunidade sobre a importância de separar corretamente os resíduos e o impacto positivo dessa ação no meio ambiente\", afirma.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Já a Professora Dr. Mariana Ferreira, do Departamento de Biologia, destaca as oficinas práticas realizadas com a comunidade. \"Nas oficinas, mostramos na prática como separar o lixo, quais materiais são recicláveis e como reutilizar objetos do dia a dia. Essas atividades têm um grande impacto, especialmente nas escolas, onde as crianças se tornam multiplicadoras do conhecimento\", ressalta.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>O projeto \"Reciclar para Preservar\" também conta com a parceria de empresas locais de reciclagem, o que garante que os resíduos coletados tenham o destino correto. Além disso, o projeto promove a integração de catadores de materiais recicláveis, valorizando seu trabalho e proporcionando melhores condições de atuação.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Os resultados têm sido extremamente positivos. A UFSM já registra uma redução significativa na quantidade de resíduos destinados ao aterro sanitário e um aumento na quantidade de materiais reciclados. A comunidade universitária e local tem se mostrado cada vez mais engajada e consciente da importância da reciclagem.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Para o futuro, a equipe coordenadora planeja expandir o projeto para outras áreas da cidade e incluir novas ações, como a compostagem de resíduos orgânicos e a promoção de práticas de consumo consciente. A UFSM, através de suas ações de extensão, continua a fortalecer seu compromisso com a sustentabilidade, contribuindo para um ambiente mais limpo e saudável para todos.</p>\n<!-- /wp:paragraph -->','Reciclar para Preservar','','publish','open','open','','reciclar-para-preservar','','','2024-08-13 17:18:01','2024-08-13 20:18:01','',0,'http://localhost/wordpress/?p=78',0,'post','',0),(79,1,'2024-07-30 15:07:56','2024-07-30 18:07:56','','Young woman and her younger brother recycling garbage at home.','Young woman and her younger brother recycling garbage at home.','inherit','open','closed','','young-woman-and-her-younger-brother-recycling-garbage-at-home','','','2024-07-30 15:07:56','2024-07-30 18:07:56','',78,'http://localhost/wordpress/wp-content/uploads/2024/07/istockphoto-1323095339-2048x2048-2.jpg',0,'attachment','image/jpeg',0),(82,1,'2024-07-30 15:12:19','2024-07-30 18:12:19','<!-- wp:paragraph -->\n<p>A Universidade Federal de Santa Maria (UFSM) está ativamente engajada em iniciativas que promovem o bem-estar animal, evidenciando seu compromisso com a responsabilidade social e ambiental. Um dos projetos de destaque é o \"Cuidando de Patinhas\", que tem como foco o cuidado e a reabilitação de animais abandonados ou de rua na região.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Sob a coordenação da Professora Dr. Patrícia Souza e do Professor Dr. Marcos Lima, o projeto reúne uma equipe dedicada de alunos dos cursos de Medicina Veterinária, Zootecnia, e Biologia. Juntos, eles trabalham incansavelmente para resgatar, tratar e encontrar lares para animais em situação de abandono.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>A Professora Dr. Patrícia Souza, do Departamento de Medicina Veterinária, destaca a importância da conscientização e educação da comunidade sobre o abandono e maus-tratos de animais. \"Nossa missão vai além do resgate. Queremos sensibilizar as pessoas sobre a responsabilidade de ter um animal de estimação e promover a adoção responsável\", afirma.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>O Professor Dr. Marcos Lima, do Departamento de Zootecnia, enfatiza a importância do cuidado adequado e da reabilitação dos animais resgatados. \"Oferecemos tratamento veterinário completo, incluindo vacinação, castração e cuidados nutricionais. Também trabalhamos na socialização desses animais, preparando-os para uma nova vida em um lar amoroso\", explica.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>O projeto \"Cuidando de Patinhas\" também promove campanhas de adoção e eventos de conscientização, onde a comunidade é convidada a conhecer os animais e aprender mais sobre a importância do cuidado responsável. Além disso, o projeto estabelece parcerias com ONGs e protetores independentes para ampliar o alcance de suas ações.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Os resultados têm sido inspiradores. Desde o início do projeto, centenas de animais foram resgatados, tratados e encaminhados para novos lares. A UFSM tem se tornado um ponto de referência na região para questões relacionadas ao bem-estar animal, contando com o apoio e o engajamento crescente da comunidade.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Para o futuro, a equipe coordenadora pretende expandir as atividades do projeto, incluindo a construção de um abrigo maior e a criação de programas de educação continuada sobre cuidados animais nas escolas locais. A UFSM, através do projeto \"Cuidando de Patinhas\", reafirma seu compromisso com a proteção e o cuidado dos animais, promovendo uma cultura de respeito e compaixão na sociedade.</p>\n<!-- /wp:paragraph -->','Cuidando de Patinhas','','publish','open','open','','cuidando-de-patinhas','','','2024-08-13 17:17:54','2024-08-13 20:17:54','',0,'http://localhost/wordpress/?p=82',0,'post','',0),(83,1,'2024-07-30 15:12:08','2024-07-30 18:12:08','','centro-de-zoonoses-pet','','inherit','open','closed','','centro-de-zoonoses-pet','','','2024-07-30 15:12:08','2024-07-30 18:12:08','',82,'http://localhost/wordpress/wp-content/uploads/2024/07/centro-de-zoonoses-pet.jpg',0,'attachment','image/jpeg',0),(100,1,'2024-07-30 15:19:18','2024-07-30 18:19:18','<style>/*! elementor - v3.23.0 - 05-08-2024 */\n.elementor-column .elementor-spacer-inner{height:var(--spacer-size)}.e-con{--container-widget-width:100%}.e-con-inner>.elementor-widget-spacer,.e-con>.elementor-widget-spacer{width:var(--container-widget-width,var(--spacer-size));--align-self:var(--container-widget-align-self,initial);--flex-shrink:0}.e-con-inner>.elementor-widget-spacer>.elementor-widget-container,.e-con>.elementor-widget-spacer>.elementor-widget-container{height:100%;width:100%}.e-con-inner>.elementor-widget-spacer>.elementor-widget-container>.elementor-spacer,.e-con>.elementor-widget-spacer>.elementor-widget-container>.elementor-spacer{height:100%}.e-con-inner>.elementor-widget-spacer>.elementor-widget-container>.elementor-spacer>.elementor-spacer-inne