/2024/07/f72e5a60ab448a204c4f0ba69dbf652b-1.png\" alt=\"\" />													\n		<p>Projeto de Lei</p><p>A Resolução CNE/CES nº 7/2018 estabelece as Diretrizes para a Extensão na Educação Superior Brasileira. Ela determina que, no mínimo, 10% da carga horária dos cursos de graduação sejam dedicados a atividades de extensão, integrando ensino e pesquisa para promover a interação transformadora entre a universidade e a sociedade.</p><p>O que fazemos? </p><p>Facilitamos a curricularização e o registro de extensão em diversas universidades pelo país, tornando o processo mais ágil e simples. Com o suporte tecnológico da RNP e a expertise do GT-MaisAção, ajudamos a implementar as diretrizes da Resolução CNE/CES nº 7/2018, assegurando que as universidades cumpram seus objetivos extensionistas de maneira eficiente.</p>		\n					<ul>\n							<li>\n							<svg aria-hidden=\"true\" viewBox=\"0 0 640 512\" xmlns=\"http://www.w3.org/2000/svg\"><path d=\"M192 256c61.9 0 112-50.1 112-112S253.9 32 192 32 80 82.1 80 144s50.1 112 112 112zm76.8 32h-8.3c-20.8 10-43.9 16-68.5 16s-47.6-6-68.5-16h-8.3C51.6 288 0 339.6 0 403.2V432c0 26.5 21.5 48 48 48h288c26.5 0 48-21.5 48-48v-28.8c0-63.6-51.6-115.2-115.2-115.2zM480 256c53 0 96-43 96-96s-43-96-96-96-96 43-96 96 43 96 96 96zm48 32h-3.8c-13.9 4.8-28.6 8-44.2 8s-30.3-3.2-44.2-8H432c-20.4 0-39.2 5.9-55.7 15.4 24.4 26.3 39.7 61.2 39.7 99.8v38.4c0 2.2-.5 4.3-.6 6.4H592c26.5 0 48-21.5 48-48 0-61.9-50.1-112-112-112z\"></path></svg>						\n										Quem Somos?\n									</li>\n						</ul>\n			<style>/*! elementor - v3.23.0 - 05-08-2024 */\n.elementor-widget-divider{--divider-border-style:none;--divider-border-width:1px;--divider-color:#0c0d0e;--divider-icon-size:20px;--divider-element-spacing:10px;--divider-pattern-height:24px;--divider-pattern-size:20px;--divider-pattern-url:none;--divider-pattern-repeat:repeat-x}.elementor-widget-divider .elementor-divider{display:flex}.elementor-widget-divider .elementor-divider__text{font-size:15px;line-height:1;m